import { Button } from "@mui/material";
import React from "react";
import Navbar from "./Navbar";

const App = () => {
  return (
    <>
      <div className="landing">
        <Navbar />
        <h1>A modern publishing platform</h1>
        <p>Grow your audience and build your online brand</p>
        <Button></Button>
      </div>
    </>
  );
};

export default App;
